import React from "react";
import record from "./db.json";
const Home = () => {
    // console.log(Record)
  return (
    <>
      <div className="container">

         {record?.map((val)=>
         {
            console.log(val)
          return (
            <>
            <p>{val.name}</p>  
            <p>{val.data[0].time}</p>
            </>
          )
         })}

      </div>
    </>
  );
};

export default Home;
